void init(long skipPointer, int df) {
  this.skipPointer[0] = skipPointer;
  this.docCount = df;
  Arrays.fill(skipDoc, 0);
  Arrays.fill(numSkipped, 0);
  haveSkipped = false;
  for (int i = 1; i < numberOfSkipLevels; i++) {
    skipStream[0] = null;
  }
}

